      json: '{\n  "summary": "Ronak, the marketing head of a book store, shared that the target audience for the ads ranges from young students to older people who enjoy all genres of books. The promotion for the Big April festival includes a 15% discount for repeat customers and a 20% discount for new customers throughout the festival period. The store specializes in popular titles such as the Harry Potter series in the fantasy genre and Agatha Christie\'s murder mystery books. Ronak prefers a red and black color scheme for the ads, with no specific taglines provided.",\n  "variants": [\n    {\n      "confidence": "80%",\n      "adType": "Facebook Ad",\n      "variantNo": "1",\n      "imageUrl": "https://example.com/image1.jpg",\n      "oneLiner": "Discover magic in every page",\n      "imageDescription": "The frame is bold and eye-catching, predominantly using red and black colors to create a mysterious and captivating atmosphere. The subject includes diverse book covers from fantasy and mystery genres. The style is modern and sleek, emphasizing the joy of reading and exploration.",\n      "adOrientation": "Dynamic layouts with a magical theme",\n      "rationale": "This ad appeals to the diverse target audience by showcasing popular fantasy and mystery genres. The red and black color scheme creates a sense of excitement and mystery, while the promotional discount highlights the value proposition to both repeat and new customers.",\n      "text": "Uncover new worlds with our April Festival discounts! Enjoy 15% off if you\'re a return customer and an enticing 20% discount for first-time visitors. Dive into the magical realms of Harry Potter and the gripping mysteries of Agatha Christie at our bookstore.",\n      "campaignName": "Magical Book Festival",\n      "campaignObjective": "sales",\n      "adsetName": "April Festival Discounts",\n      "adName": "Magic & Mystery Ad"\n    },\n    {\n      "confidence": "85%",\n      "adType": "Instagram Ad",\n      "variantNo": "2",\n      "imageUrl": "https://example.com/image2.jpg",\n      "oneLiner": "Unlock the secrets of a good book",\n      "imageDescription": "The frame features an elegant and stylish layout with a mix of red and black elements. The subject showcases a magical book opening reveal for the fantasy genre and a dramatic crime scene for the mystery genre. The style is sophisticated and engaging, drawing viewers into the stories.",\n      "adOrientation": "Sleek and captivating visuals",\n      "rationale": "This ad emphasizes the allure of reading by highlighting the enchanting worlds of fantasy and the intrigue of mystery. The red and black color scheme conveys a sense of sophistication and elegance, appealing to the diverse age groups targeted by the campaign.",\n      "text": "Experience the thrill of reading with our April Festival discounts! Get 15% off on your favorite fantasy adventures and unravel the mysteries with a 20% discount on captivating crime novels. Visit us and discover the magic of books!",\n      "campaignName": "Enchanted Reading Festival",\n      "campaignObjective": "sales",\n      "adsetName": "April Festival Specials",\n      "adName": "Enchantment Ad"\n    }\n  ],\n  "disclaimer": "All promotions are subject to availability and terms. The Big April festival discounts are valid for a limited time only.",\n  "companyName": "Ronak\'s Book Store",\n  "adObjective": "sales"\n}',
